package nurier.scraping.member.project.model.VO;

public class ProjectInVO {
	private String pCode;		// 프로젝트 코드
	private String memberId;	// 사원 ID
	private String pStart;		// 프로젝트 투입일
	private String pEnd;			// 프로젝트 철수일
	private String dutyName;	// 담당업무
	
	public ProjectInVO() {
		super();
		// TODO Auto-generated constructor stub
	}

	public ProjectInVO(String pCode, String memberId, String pStart, String pEnd, String dutyName) {
		this.pCode = pCode;
		this.memberId = memberId;
		this.pStart = pStart;
		this.pEnd = pEnd;
		this.dutyName = dutyName;
	}

	public String getpCode() {
		return pCode;
	}

	public void setpCode(String pCode) {
		this.pCode = pCode;
	}

	public String getMemberId() {
		return memberId;
	}

	public void setMemberId(String memberId) {
		this.memberId = memberId;
	}

	public String getpStart() {
		return pStart;
	}

	public void setpStart(String pStart) {
		this.pStart = pStart;
	}

	public String getpEnd() {
		return pEnd;
	}

	public void setpEnd(String pEnd) {
		this.pEnd = pEnd;
	}

	public String getDutyName() {
		return dutyName;
	}

	public void setDutyName(String dutyName) {
		this.dutyName = dutyName;
	}
	
}
